import React from "react";
import Header from "./Header";
import Home from "./Home";
import Footer from "./Footer";
import "./App.css";
import Board from "./Board";
import {Routes, Route} from "react-router-dom";

function App() {
  return (
      <div className="App">

        <Routes>
          <Route path="/">
            <Header />
            <Home />
            <Footer />
          </Route>

          <Route path="/board">
            <Header />
            <Board />
            <Footer />
          </Route>

        </Routes>
      </div>
  );
}

export default App;
